Text:
@keknaab

Well if malware popping up at the EXACT time when I finished downloading this torrent isn't indication of a virus, I don't know what is. Coincidence? Extremely slim. The fact that the uploader is anonymous makes it even more likely.

All I know is that the virus in question could potentially force me to format my computer. Download the torrent if you want, but don't whine about a virus when I gave ample warning to avoid this torrent. If the download worked without problems, more power to you.
